import React from 'react';
import MetricsBarPlot from './components/MetricsBarPlot';
import './index.css';

function App() {
  return (
    <div className="min-h-screen bg-gray-100">
      <div className="container mx-auto px-4 py-8">
        <h1 className="text-4xl font-bold text-center-center mb-8 text-gray-800">
          Addition of Expected Goals (xG) in Football Outcome Prediction Evaluation Visualization
        </h1>
        <MetricsBarPlot />

        {/* Footer */}
        <footer className="text-center mt-8 text-gray-600">
          <p>Built with React, Tailwind CSS & Recharts</p>
        </footer>
      </div>
    </div>
  );
}

export default App;
